window.bookSummaryJSON = "<p><b>In space, isolation is a slow killer. Company quickens the pace.</b></p> <p>Waking up adrift in an ancient battleground, Alex is left dazed and confused with no clue how she ended up trapped aboard a failing vessel. With only a mysterious voice in her head to guide her she must act in order to survive.</p> <p>Every piece of the puzzle she collects only leads to more questions about her origins and the star she's trapped around might not be as deserted as she first thought.</p> <p>All she knows for sure is that she could die at any minute, but Alex is not going to go down without a fight.</p> <p><b>Don't miss the start of this space faring, survival LitRPG Adventure filled with game elements, vivid characters that are easy to root for, an evolving A.I., explosive ship battles, and so much more. Grab your copy today!</b></p>"; 
